void quicksort(long long x[10], long long first, long long last)
{
  long long pivot;
  long long j;
  long long temp;
  long long i;
  if (first < last)
  {
    pivot = first;
    i = first;
    j = last;
    while (i < j)
    {
      while ((x[i] <= x[pivot]) && (i < last))
        i++;

      while (x[j] > x[pivot])
        j--;

      if (i < j)
      {
        temp = x[i];
        x[i] = x[j];
        x[j] = temp;
      }

    }

    temp = x[pivot];
    x[pivot] = x[j];
    x[j] = temp;
    quicksort(x, first, j - 1);
    quicksort(x, j + 1, last);
  }

}

