typedef struct queue
{
  int f;
  int r;
  int capacity;
  int size;
  int *arr;
} q;
q *createqueue(int c)
{
  q *Q = (q *) malloc(sizeof(q));
  Q->f = -1;
  Q->r = -1;
  Q->capacity = c;
  Q->size = 0;
  Q->arr = (int *) malloc(c * (sizeof(int)));
  return Q;
}

void Enqueue(q *Q, int data)
{
  if ((Q->f == (-1)) && (Q->r == (-1)))
  {
    Q->f = 0;
    Q->r = 0;
    Q->arr[Q->f] = data;
  }
  else
  {
    Q->arr[++Q->r] = data;
  }

  Q->size++;
}

int Dequeue(q *Q)
{
  return Q->arr[Q->f++];
}

