int gcd(int x, int y)
{
  int divisor;
  int dividend;
  int rem;
  divisor = (x <= y) ? (x) : (y);
  dividend = (x >= y) ? (x) : (y);
  while (divisor != 0)
  {
    rem = dividend % divisor;
    dividend = divisor;
    divisor = rem;
  }

  return dividend;
}

