{
  int mid;
  int temp;
  int i;
  int j;
  i = left;
  j = right;
  mid = data[(left + right) / 2];
  while (i <= j)
  {
    while (data[i] < mid)
      i++;

    while (mid < data[j])
      j--;

    if (i <= j)
    {
      temp = data[i];
      data[i] = data[j];
      data[j] = temp;
      i++;
      j--;
    }

  }

