int Merge_Sort(int a[], int p, int r)
{
  int q;
  int i;
  if (p < r)
  {
    q = (p + r) / 2;
    Merge_Sort(a, p, q);
    Merge_Sort(a, q + 1, r);
    Merge(a, p, q, r);
  }

}

int Merge(int a[], int p, int q, int r)
{
  int n1;
  int n2;
  int i;
  int j;
  int k;
  int t1;
  int k1;
  n1 = (q - p) + 1;
  n2 = r - q;
  int L[n1];
  int R[n2];
  for (i = 1; i <= n1; i++)
    L[i] = a[(p + i) - 1];

  for (j = 1; j <= n2; j++)
    R[j] = a[q + j];

  i = 1;
  j = 1;
  for (k = p; k <= r; k++)
  {
    if (L[i] <= R[j])
    {
      a[k] = L[i];
      i++;
      if (i > q)
      {
        t1 = 1;
        break;
      }

    }
    else
    {
      a[k] = R[j];
      j++;
      if ((j + q) > r)
      {
        t1 = 0;
        break;
      }

    }

  }

  if (t1 == 1)
  {
    for (k1 = k + 1; k1 <= r; k1++)
    {
      a[k1] = R[j];
      j++;
    }

  }
  else
  {
    for (k1 = k + 1; k1 <= r; k1++)
    {
      a[k1] = L[i];
      i++;
    }

  }

}

