int findpathsum(int triangle[][101], int i, int j)
{
  int val1;
  int val2;
  if (triangle[i][j] == (-1))
    return 0;

  if (solution[i + 1][j] == (-1))
  {
    val1 = findpathsum(triangle, i + 1, j);
    solution[i + 1][j] = val1;
  }
  else
  {
    val1 = solution[i + 1][j];
  }

  if (solution[i + 1][j + 1] == (-1))
  {
    val2 = findpathsum(triangle, i + 1, j + 1);
    solution[i + 1][j + 1] = val2;
  }
  else
  {
    val2 = solution[i + 1][j + 1];
  }

  if (val1 > val2)
    return triangle[i][j] + val1;
  else
    return triangle[i][j] + val2;

}

