long long gcd(long long a, long long b)
{
  if ((a == 0) || (b == 0))
    return 0;

  if (a == b)
    return a;

  if (a > b)
    return gcd(a - b, b);

  return gcd(a, b - a);
}

long long lcm(long long a, long long b)
{
  return (a * b) / gcd(a, b);
}

