int Partition(long long int A[], int p, int r)
{
  long long int x = A[r];
  long long int temp;
  int i = p - 1;
  int j;
  for (j = p; j < r; j++)
  {
    if (A[j] <= x)
    {
      i = i + 1;
      temp = A[i];
      A[i] = A[j];
      A[j] = temp;
    }

  }

  temp = A[i + 1];
  A[i + 1] = A[r];
  A[r] = temp;
  return i + 1;
}

void QuickSort(long long int A[], int p, int r)
{
  if (p < r)
  {
    int q = Partition(A, p, r);
    QuickSort(A, p, q - 1);
    QuickSort(A, q + 1, r);
  }

  return;
}

